import React from "react";
import Footer from "./footer";
import { SearchIcon } from "./icons";
import NavBar from "./navbar";
class ProductPage extends React.Component {
  render() {
    return (
      <div>
        <NavBar color="black" active="login" />
        {/* Search */}
        <div className="bg-red-00 pt-36 pb-20 px-2 md:flex items-center">
          <div className="bg-white border-2 border-gray-400 flex h-12 items-center rounded-md max-w-xl md:w-2/3 md:ml-10">
            <div className="mx-5 md:mx-10">
              <SearchIcon
                height={25}
                width={25}
                color="rgba(68, 68, 68, 0.7)"
              />
            </div>
            <input
              type="text"
              placeholder="Search products, brands and categories"
              className="text-xs h-8 w-full focus:outline-none"
            />
          </div>
          <button className="text-sm block text-white h-10 w-28 bg-yellow-500 rounded-md mt-2 md:mt-0 tracking-wide md:mx-4 py-1">
            SEARCH
          </button>
        </div>
        <div>
          {/* items-card */}
          <div>
            {/* top/left */}
            <div>
              <div>{/* image */}</div>
              <div>{/* slider */}</div>
            </div>
            {/* bottom/right */}
            <div>
              <div>{/* phonename and rating */}</div>
              <div>{/* price tags */}</div>
              <div>{/* available colors */}</div>
              <div>{/* btns */}</div>
            </div>
          </div>
        </div>
        <Footer />
      </div>
    );
  }
}

export default ProductPage;
